export default function WillUnmountUseEffect() {

    useEffect(() => {
        // Side effect code here
        console.log('WComponent mounted');

        // Cleanup function
        return () => {
            console.log('Component unmounted');
        };
    }, []);

    return <div>Will Unmount UseEffect</div>;
}
